import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const Text = props => {
    return (

        <Card className="col gy-4" bg="info" key="1" text="white">
            <Card.Header>{props.title}</Card.Header>
            <Card.Body>
                <Card.Text>{props.text}</Card.Text>
            </Card.Body>
        </Card>
        )
}

export default Text;
